      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "16. Bey hrn. Rudolph Ramperger an der Huthgas ist extra guter Holländer-Taback in bleyernen Pfund-Büchsen à 10 Bazen, wie auch guter St. Vincent à 3 Rr. zu haben."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "17. Wo guter Art grosse Bohnen zum Seßen, und kleine weisse dito zum Kochen in billigem Preis zu haben, ist im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "18. Zwey Baretlein oder Professor-Hüth, wie auch ein ganz neuer Castor-Huth, mittelmåssiger Grösse, im Berichthaus zu erfragen."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "19. Bey hrn. Burhardt zum Riesen sind extra neue grosse Italienische Feigen, dito grosse Meertrauben mit und ohne Stiel, Haselnuss, dürre Morcheln, feiner Chocoladen, alles in billigem Preis zu haben."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "20. Zwölf Sack neuer Waizen in billigem Preis, im Berichthause ohne Entgeld zu erfragen."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "21. Bey hrn. Jacob Grimms Buchbinder ist zu haben: Ein Kriegs-Atlas von 63 theils Land-Karten, Städten, Plans von Bataillen und Belagerungen des jezigen Kriegs. 2) Die Welt in einer Nuss mit Kupfern. 3) Die Durchlauchtige Welt, 4 Theil mit Waapen. 4) Journal du Camp de Compiegne avec figures."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "22. Zwey saubere frantzösische Bether in ein Wirthshaus auf das Land oder in ein Bad dienlich, ohnentgeldlich im Berichthaus zu erfragen."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "23. Eine Behausung in der Reischemer Vorstadt mit 4 Stuben, 5 Kammern samt einer grossen Werkstatt, Essig und einem schönen gewölbten Keller und Garten, wesshalb sich bey hrn. Jacob Möglin dem Weinmann anzu melden."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "24. Ein Freund, welcher circa 600 Sester Hanf-Saamen anhero liefern könnte, möchte aber solchen vorhero verkauft wissen, offeriert selbigen daher in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "25. Wo guter alter weisser Wein zu haben, ist bey Mstr. Michael Fuchs dem Küefer zu vernehmen."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "26. Circa 6. Saum extra guter alter rother Pölsener Wein, so gut als Neuenburger oder Burgunder, in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "27. Zwey Stücklein weissen Wein von 1750. 8 Pfund 10 s der Saum im einten, und 8 Pfund im andern, wovon nach Belieben zu haben, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "28. Ein Stock hebt ob 3 Thånen Matten vorm Riechemer-Thor oberhalb der Schorendruck. Ferner ein Stücklein von 7 Saumen rothes Hölliger-Wein von 1750. schön roth und lauter, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "29. Auf E. E. Funkt zum Båren sind wiederum neue Saure Rüben in billigem Preis zu haben."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "30. Ein roth Scharlachen Camisol und Hosen in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "31. Im Offenburger - Hof ist wohlverwährter Bau zu haben."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "32. Ein Brennhäuslein bey der Steinen-Mühlin mit aller Kommlichkeit, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "33. Bey weme rother und weisser Burgunder, wie auch Muscat-Wein, Pieceenweis wegen Mangel Plazes, wie auch roth und weisser 1753iger Margråser-Wein in billigem Preis zu haben, ist im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "34. Feine heitergelbe hamburger Strick-Wollen das Pfund à 6 Pfund, wo dieselbe Pfundweis zu haben, ist im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "35. Herrn Hofzach des Steggrifs Behausung im Spieg-Häuslein mit 4 Stuben, 3 Kammern &c. ist entweder zu verkaufen, oder samethaft zu verlehien."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "36. Weisse und rothe Margråser-Weine von 1760. wovon in billigem Preis nach Belieben zu haben, im Berichthaus zu erfragen."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "37. Ein Mannssis in St. Peters Kirch auf dem Letner. Item ein grün Lombrau-Bethlein mit grünen wollenen Umhången, in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "38. Ein Hausschüitten mit einem schönen Bild und Zugehört in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1753-03-30",
      "tags_section": null,
      "ntokens": null,
      "text": "39. Der Bärenfeller-Hof zu St. Peter, mit Garten, Stallung, Keller &c. wie der Augenschein zeigen wird. In Ermanglung eines Käufers"
